        // time series to sax string
        public static string ArrayToSaxStr(double[] ts, SaxOptions options)
        {
            return SaxValsToSaxStr(ArrayToSaxVals(ts, options));
        }


        // time series to sax value vector
        public static ushort[] ArrayToSaxVals(double[] ts, SaxOptions options)
        {
            Dictionary<ushort, ushort[]> res = new Dictionary<ushort, ushort[]>(3);
            ReadOnlyCollection<ushort> mask = options.Mask;
            byte wordLen = Globals.SaxWordLength;

            foreach (ushort val in mask)
            {
                if (!res.ContainsKey(val))
                {
                    ushort card = ComputeCard(val, Globals.SaxBaseCard);
                    res.Add(val, ConvertSAX(ts, wordLen, card));  // change to incremental
                }
            }

            ushort[] values = new ushort[wordLen];
            for (int i = 0; i < wordLen; i++)
            {
                values[i] = res[mask[i]][i];
            }

            res.Clear();
            return values;
        }

        // data descriptor to sax string
        public static string SaxDataRepToSaxStr(SaxData dr, SaxOptions options)
        {
            Dictionary<ushort, ushort[]> res = new Dictionary<ushort, ushort[]>();
            ReadOnlyCollection<ushort> mask = options.Mask;
            byte wordLen = Globals.SaxWordLength;
            ushort[] drVals = dr.values;
            ushort origCard = Globals.SaxMaxCard;

            // obtain output for each resolution found in the mask
            foreach (ushort val in mask)
            {
                if (!res.ContainsKey(val))
                {
                    ushort card = ComputeCard(val, Globals.SaxBaseCard);
                    res.Add(val, ConvertSAX(drVals, origCard, card));
                }
            }

            ushort[] values = new ushort[wordLen];
            for (int i = 0; i < wordLen; i++)
            {
                values[i] = res[mask[i]][i];
            }

            res.Clear();
            return SaxValsToSaxStr(values);
        }

        // base 2 cardinality
        private static ushort ComputeCard(ushort maskVal, ushort baseCard)
        {
            return (ushort)(Math.Pow(2, maskVal) * baseCard);
        }

        // convert sax from higher cardinality to lower
        private static ushort[] ConvertSAX(ushort[] origVals, ushort highCard, ushort targetCard)
        {
            ushort[] newVals = (ushort[])origVals.Clone();
            if (highCard < targetCard)
                throw new ApplicationException("Target cardinality exceeds original value");

            if (Math.IEEERemainder(highCard, targetCard) != 0)
                throw new ApplicationException("highCard and targetCard non-divisible");

            int shifts = (int)(Math.Log(highCard, 2) - (int)Math.Log(targetCard, 2));
            for (int j = 0; j < newVals.Length; j++)
                newVals[j] = (ushort)(newVals[j] >> shifts);

            return newVals;
        }

