        // Make dup copies of each array element (one at a time)
        public static double[] DupArray(double[] data, int dup)
        {
            int cur_index = 0;
            double[] dup_array = new double[data.Length * dup];

            for (int i = 0; i < data.Length; i++)
            {
                for (int j = 0; j < dup; j++)
                {
                    dup_array[cur_index + j] = data[i];
                }

                cur_index += dup;
            }
            return dup_array;
        }

