        // Get the GCD (greatest common divisor) between the
        // length of the time series and the number of PAA
        // segments
        private static int GetGCD(double[] time_series, int num_seg)
        {
            int u = time_series.Length;
            int v = num_seg;
            int div;
            int divisible_check;

            while (v > 0)
            {
                div = (int)Math.Floor((double)u / (double)v);
                divisible_check = u - v * div;
                u = v;
                v = divisible_check;
            }
            return u;
        }

        // Get the least common multiple of the length of the time series and the
        // number of segments
        private static int GetLCM(double[] time_series, int num_seg)
        {
            int gcd = GetGCD(time_series, num_seg);
            int len = time_series.Length;
            int n = num_seg;
            return (len * (n / gcd));
        }

        private static double GetMax(double[] data)
        {
            double max = data[0];

            for (int i = 1; i < data.Length; i++)
            {
                if (data[i] > max)
                    max = data[i];
            }
            return max;
        }

        private static double GetMin(double[] data)
        {
            double min = data[0];

            for (int i = 1; i < data.Length; i++)
            {
                if (data[i] < min)
                    min = data[i];
            }
            return min;
        }

        private static double[] GetPAA(double[] data, int num_seg)
        {
            if (Math.IEEERemainder(data.Length, num_seg) != 0)
                throw new ApplicationException("Datalength not divisible by number of segments!");

            // Determine the segment size
            int segment_size = data.Length / num_seg;

            int offset = 0;

            double[] PAA = new double[num_seg];

            // if no dimensionality reduction, then just copy the data
            if (num_seg == data.Length)
            {
                Array.Copy(data, PAA, data.Length); //PAA = data;
            }

            for (int i = 0; i < num_seg; i++)
            {
                PAA[i] = SaxIndex.Util.Mean(data, offset, offset + (int)segment_size - 1);
                offset = offset + (int)segment_size;
            }

            return PAA;
        }

        private static ushort[] GetSymbol(double[] PAA, int num_seg, ushort alphabet_size)
        {
            bool FOUND = false;
            ushort[] symbols = new ushort[num_seg];
            for (int i = 0; i < num_seg; i++)
            {
                for (int j = 0; j < alphabet_size - 1; j++)
                {
                    if (PAA[i] <= breakpoints[alphabet_size][j])
                    {
                        symbols[i] = (ushort)j;// lowest val = 1, card 4 - 4th-j(3) = 1
                        //		symbols[i] = (byte)(j + 1);
                        FOUND = true;
                        break;
                    }
                }

                if (!FOUND)
                {
                    //					symbols[i] = (byte)alphabet_size;
                    symbols[i] = (ushort)(alphabet_size - 1);
                }
                FOUND = false;
            }
            return symbols;
        }

