        public static double MinDistPAAToiSAX(ushort[] saxVals, SaxOptions opts, double[] timeSeries)
        {
            if (saxVals.Length <= 1 || saxVals.Length != Globals.SaxWordLength)
                throw new ApplicationException("Invalid or Uneven length for ushort [] arrays.");

            double minDist = 0.0;
            int wordLen = saxVals.Length;
            int? dupRatio = null;
            double remainder = Math.IEEERemainder(timeSeries.Length, wordLen);

            // if not divisible, expand timeseries sufficiently
            if (remainder != 0)
            {
                int lcm = GetLCM(timeSeries, wordLen);
                dupRatio = lcm / timeSeries.Length;
                timeSeries = DupArray(timeSeries, dupRatio.Value);
#if DEBUG
                Assert.AreEqual(lcm, timeSeries.Length);
                Assert.AreEqual(0, Math.IEEERemainder(timeSeries.Length, wordLen));
#endif
            }

            double[] PAA = GetPAA(timeSeries, wordLen);
            Assert.AreEqual(PAA.Length, wordLen);
            int segmentSize = timeSeries.Length / wordLen;
            ReadOnlyCollection<ushort> optsMask = opts.Mask;

            for (int i = 0; i < wordLen; i++)
            {
                // PAA[offset]
                ushort card = ComputeCard(optsMask[i], Globals.SaxBaseCard); // card for this value
                double tVal = PAA[i];
                double ptDist = 0.0;

                // #refactor, use +-inf
                if (saxVals[i] == 0)
                {
                    double lrgr = breakpoints[card][saxVals[i]];
                    if (tVal > lrgr)
                        ptDist = Math.Pow((tVal - lrgr), 2);
                }
                //  highest card(val) 
                else if (saxVals[i] == card - 1)
                {
                    double smlr = breakpoints[card][saxVals[i] - 1];
                    if (tVal < smlr)
                        ptDist = Math.Pow((tVal - smlr), 2);
                }
                // check if pt falls on either side of breakpt region
                else
                {
                    double smlr = breakpoints[card][saxVals[i] - 1];
                    double lrgr = breakpoints[card][saxVals[i]];

                    if (tVal > lrgr)
                    {
                        ptDist = Math.Pow((tVal - lrgr), 2);
                    }
                    else if (tVal < smlr)
                    {
                        ptDist = Math.Pow((tVal - smlr), 2);
                    }
                }
                ptDist /= dupRatio ?? 1;
                ptDist *= segmentSize;
                minDist += ptDist;
            }
            minDist = Math.Sqrt(minDist);
            return minDist;
        }

        public static ushort[] SaxStrToSaxVals(string saxString)
        {
            string[] vals = saxString.Split(new char[] { '_' });
            ushort[] saxVals = new ushort[vals.Length];
            for (int i = 0; i < vals.Length; i++)
                saxVals[i] = ushort.Parse(vals[i]);
            return saxVals;
        }

        public static string SaxValsToSaxStr(ushort[] values)
        {
            if (values == null)
                throw new ApplicationException("ushort [] is null");

            StringBuilder sb = new StringBuilder(values.Length * 2 - 1);
            for (int i = 0; i < values.Length - 1; i++)
                sb.AppendFormat("{0}_", values[i]);
            sb.Append(values[values.Length - 1]);

            return sb.ToString();
        }
